import React, {Component} from 'react';
import user_service from '../services/user';

class App extends Component{
    constructor(props){
        super(props);
        this.user = new user_service();
    }

    componentDidMount(){
        console.log('COMPONENT DID MOUNTED')
        this.user.logIn({
            username: 'dani', 
            password: 'dani123'
        });
    }
    render(){
        return (<div>HOLA MANUEL</div>);
    }
}

export default App;
